import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/Manage.vue'
import Manage from "@/views/Manage";
import 'lib-flexible/flexible.js'


Vue.use(VueRouter)

const routes = [{
    path: '/',
    component: ()=>import('../views/Manage.vue'),
    redirect: "/login", //首页配置
    children:[
        // {
        //     path:'home',name:'Home',component: ()=>import('../views/HomeView.vue')
        // },
        {
            path:'InstrumentaManage',name:'InstrumentaManage',component:()=>import('../views/InstrumentaManage')
        },
        {
            path:'Time_SpaceAnalysis',name:'Time_SpaceAnalysis',component: ()=>import('../views/Time_SpaceAnalysis.vue')
        },
        {
            path:'MapSearch',name:'MapSearch',component:()=>import('../views/MapSearch')
        },
        {
            path:'TrackingOfPollutants',name:'TrackingOfPollutants',component: ()=>import('../views/TrackingOfPollutants.vue')
        },
        {
            path:'DataAnalysis',name:'DataAnalysis',component:()=>import('../views/DataAnalysis')
        },
    ] //子路由
},
    {
        path: '/login',
        name:'Login',
        component:()=>import('../views/Login')
    }
]

const router = new VueRouter({
  // mode: 'history',
  base: '/test/',
  routes
})

export default router
